if mibBuilder.loadTexts: vRtrIfCpmProtUncfgdProtoDropCnt.setStatus('current')
if mibBuilder.loadTexts: vRtrIfCpmProtUncfgdProtoDropCnt.setDescription("The value of vRtrIfCpmProtUncfgdProtoDropCnt indicates the number of network control protocol messages dropped due to the operation of the protocol protection facility. The protocol protection facility can be enabled and disabled by means of the object TIMETRA-SECURITY-MIB::tmnxCpmProtDropUncfgdProtocolMsg. When the protocol protection facility is enabled, network control protocol traffic received on this virtual router interface is dropped if the protocol is not configured on this virtual router interface. The value of vRtrIfProtocol indicates which protocols are configured on this virtual router interface. This object is not supported on SR-1 and ESS-1, where the value of ALCATEL-IND1-TIMETRA-CHASSIS-MIB::tmnxChassisType is '5', and 7710, where the value of ALCATEL-IND1-TIMETRA-CHASSIS-MIB::tmnxChassisType is '7' or '9'.")
vRtrIfLdpSyncTimer = MibTableColumn((1, 3, 6, 1, 4, 1, 6527, 3, 1, 2, 3, 4, 1, 70), Unsigned32().subtype(subtypeSpec=ConstraintsUnion(ValueRangeConstraint(0, 0), ValueRangeConstraint(1, 1800), ))).setUnits('seconds').setMaxAccess("readcreate")
if mibBuilder.loadTexts: vRtrIfLdpSyncTimer.setStatus('current')
if mibBuilder.loadTexts: vRtrIfLdpSyncTimer.setDescription("The value of vRtrIfLdpSyncTimer specifies a time interval used for IGP-LDP synchronization. The timer is started from the time the LDP session to the neighbor is up over the interface. This is to allow for the label FEC bindings to be exchanged. When the timer expires, the link cost is restored and is re-advertised. IGP will announce a new best next-hop and LDP will use it if the label binding for the neighbor's FEC is available.")
